import React from "react";
import ReactDOM from "react-dom";
import Just, { x } from "./app";

ReactDOM.render(
  <>
    {x.map((val) => (
      <Just name={val.name} age={val.age} work={val.work} />
    ))}
  </>,
  document.getElementById("root")
);
